    fetch('http://localhost:1337/api/posts')
        .then(data => data.json())
    return (
        <>
            <section>
                <h2>Servises page</h2>
                <div className="box">
                    <h2>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Non, optio.</h2>
                    <Button name="Hello"/>
                    <Button/>
                    <img src={cerImg} alt=""/>
                </div>
                <Button className="header__button" name='Open'/>
                <Link to='/blog'>Blog</Link>
            </section>
        </>
    )
}
export default Service
